actionConfiguration.body:
() => {
  const spent = TotalLineDaysUser.data.map(e => ({
    value: e.amount_spent_plus_fee
  }));
  const category = TotalLineDaysUser.data.map(e => ({
    value: moment(e.financial_date).format('YYYY-MM-DD')
  }));
  const categories = [{
    category
  }];
  const dataset = [{
    seriesname: 'Spent',
    data: spent
  }];
  return {
    dataset,
    categories
  };
}

